import React from "react";
import { Image, HStack } from '@chakra-ui/react'

const NavigationMenu = () => {
    return (
        <div>
        <Image src="https://i.ibb.co/5TyTXRr/Logo.jpg" />
         <HStack>
            <a>Home</a>
            <a href="#about" onClick={() => handleClick("about")}>About</a>
            <a>Menu</a>
            <a>Reservation</a>
            <a>Orger Online</a>
            <a>Login</a>
        </HStack>
        </div>
    )
}

export default NavigationMenu;
